import React, {Component} from 'react';

export default class Home extends Component {
    render(){
        return (
            <div>
                <h1> Home </h1>
                <ul>
                    <li> Pack1 </li>
                    <li> Pack2 </li>
                    <li> Pack3 </li>
                </ul>
            </div>
        )
    }
}
